def get_test_otu_structure() -> list[tuple[int, list[str], list[list[str]]]]:
    """Get the hardcoded test OTU structure.

    Returns:
        List of (taxid, plan_accessions, isolate_accessions) tuples
    """
    return [
        (taxid, plan, isolates)
        for taxid, (plan, isolates) in MOCK_OTU_STRUCTURE.items()
    ]
